== 解释 ==

'''○○○○，av10492'''，此用语出现在bilibili弹幕内，是用来{{rubyh|造福社会|[[报复社会]]|顶上去报复社会}}的，引新人上钩的（需要正式会员才能观看，有{{rubyh|一些正式会员|猎奇物爱好者}}表示就是为了av10492而来）。'''请注意，在弹幕或评论区随意刷“av10492”很可能会被视为无知小鬼。'''

人脸的变形取自日本恐怖漫画（后改编电影）《不安的种子》。

视频的制作：把视频人物的五官用图像编辑软件剪选、扭曲，得到极端性的恶搞效果。
视频的女主角是演员久本雅美，因为其本身参演的作品就十分[[猎奇]]，且为创价学会会员，多次被[[11区]]人民评选为最讨厌的女明星之一。
其实视频本身除部分为 真 精神污染外，大部分只是高精系音MAD，内容大多数为11区人黑创价学会的视频
