这里是1-8P全无弹幕观看后的总结。

* 1P前36秒很正常（可能有点欢乐的元素？）。到第36秒时，声音突然卡顿，发出“咔咔咔”的噪音。你有2到3秒的时间逃走。38秒，久本雅美双眼与嘴开始反转。42秒，翻转九十度，形成一个恶心鬼畜的鬼脸(后文中所指的脸就以此为准)，进入正片。后面的就是变色与鬼脸乱晃(好吧其实不知道该叫它什么)，再佐以不停重复的噪音，形成诡异恐怖的氛围。但适应后充其量只会觉得有些东西乱晃罢了。全片1分47秒。BGM是[[先进国]]。

*P2就是把“脸”P到各种麦当劳食物上。一开始有6秒的黑屏，带着啵啵啵的心跳声，营造出一种恐怖的氛围。六秒后正片，脸出现在薯饼上，进入正片。鬼畜的脸乱晃，加上“生人回避”的BGM，给人很难受的感觉。25秒换场景，但基本与之前相同。不过BGM变成了四重存在，完全不着调的BGM与神经质的黄色背景，是P2的最大亮点(个人认为)。全片47秒，很容易就可以熬过去了。

*P3全片为黑白色，有种老电影的感觉(并不)。你有两秒的时间逃跑。进入正片，黑白色调的鬼畜脸庞，诡异的BGM(好吧基本都是生人回避)，还有被拉长的说话，由开头贯穿全篇。要稍微注意的是，13秒处的人声被拉长为不知道是什么鬼的鬼叫，比较猎奇。全片长47秒，与上一P一样，但不知道为什么给人更长的感觉。

*P4一开始为白背景加久本雅美的那张脸。BGM为Otso-Otso(av3545836)，但挺欢乐的。主要就是眼睛与嘴巴在开合的细节，与10秒处左右出现的拉长与拉短的脸。22秒处，BGM戛然而止，脸开始变色，红蓝绿黄色交替渐变。27秒，啵啵啵的心跳声响起。31秒，生人回避BGM响起，宣布你已进入正片。36秒，背景变暗，脸的亮度提升、晃动。42秒，背景彻底变为黑色，脸变成暗红色。47秒，BGM停放，画面变成略黑的背景。49秒，“啊啊啊”的笑声响起，脸又出现，并从暗红色渐变成亮黄色。画面不断放大，脸就像要跳出来一样。全片到此结束，共1分3秒。

